    position: relative;
    display: inline-block;
    min-width: 40px;
    height: 20px;
    
    border-radius: 10px;
    box-sizing: border-box;
    
}
  
  /* Hide default HTML checkbox */
.switch input {
    border: 1px solid #1f204140;
    display:none;
}
  
  /* The slider */
.slider {
   
    border: 1px solid #1f204140;
    position: absolute;
    cursor: pointer;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    -webkit-transition: .4s;
    transition: .4s;
    &:checked{
        border: 1px solid #BC9CFF;
    }
}  
.slider:before {
    position: absolute;
    content: "";
    height: 12px;
    width: 12px;
    left: 3px;
    bottom: 3px;
    background: rgba(31, 32, 65, 0.25);
    -webkit-transition: .4s;
    transition: .4s;
}  
input:checked + .slider{
    border: 1px solid #BC9CFF;
}
input:checked + .slider:before {
    -webkit-transform: translateX(20px);
    -ms-transform: translateX(20px);
    transform: translateX(20px);
    background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
    
}
.slider.round {
    border-radius: 34px;
}
.slider.round:before {
    border-radius: 50%;
}

