@import "../../blocks//dropdowns/date-dropdown/date-dropdown.scss";
@import "../../blocks/buttons/toggle.scss";
@import "../../blocks/buttons/input-radio.scss";
.reg-form{
    margin-left: 5px;
    display: flex;
    z-index: 5;
    margin-top: 19px;
    margin-bottom: 19px;
    width: 380px;
    height: 646px;
    background-color: white;
    border: 1px solid rgba(0, 0, 0, 0.12);
    box-shadow: 0px 0px 25px rgba(0, 0, 0, 0.2);
    border-radius: 4px;
    @media screen and (max-width:400px){
        width:100%;
        height: 700px;
        .reg-content__button{
            width: 100%;
        }
    }
}
.reg-form__content{
    margin: 36px 30px 40px 30px;
    width: 100%;
}
.reg-form__text{
    font-family: 'Montserrat';
    font-weight: bold;
    font-size: 24px;
    color: #1F2041;
    margin-bottom: 17px;
}
.reg-form__inputs{
    margin-bottom: 24px;
    .input{
        width: 100%;
        margin-bottom: 10px;
    }
}
.reg-form__button{
    height: 44px;
}
.reg-form__inputs-radio{
    display: flex;
    align-items: center;
}
.reg-text{
    font-family: 'Montserrat';
    font-size: 12px;
    font-weight: bold;
    margin-bottom: 3.5px;
}
.reg-date{
    .date-dropdown__input{
        font-family: 'Montserrat';
        font-size: 14px;
        padding-left: 15px;
        width: 100%;
        outline: none;
        margin-bottom: 20px;
        &::-webkit-input-placeholder{
            color: rgba(31, 32, 65, 0.25);
        }
        &::-moz-placeholder{
            color: rgba(31, 32, 65, 0.25);
        }
    }
}
.reg-form__data{
    margin-bottom: -3px;
}
.reg-form__toggle{
    display: flex;
    align-items: center;
    margin-bottom: 24px;
    .toggle-text{
        font-family: 'Montserrat';
        font-size: 14px;
        color: rgba(31, 32, 65, 0.75);
        margin-left: 10px;
    }
}

.arrow-forward{
    position: absolute;
    right: 10px;
}
.reg-content__button-text{
    margin: 10px 0 10px 0;
}
.reg-form__create{
    text-decoration: none;
    font-family: 'Montserrat';
    font-weight: normal;
    font-size: 14px;
    display: flex;
    width: 100%;
    justify-content: space-between;
    align-items: center;
    margin-top: 30px;
}
.create__text{
    text-decoration: none;
    &:active{
        color: rgba(0, 0, 0, 0.5);
    }
}
.create__button{
    width: 99px;
    height: 44px;
}

